import React, { Component } from 'react';
import './Signup.css';
import { Jumbotron } from 'react-bootstrap';
import { BrowserRouter as Link } from "react-router-dom";


export default class Signup extends Component {
  constructor(props) {
    super(props);
    this.state = {
      firstname: '',
      lastname: '',
      email: '',
      email2: '',
      password: '',
      password2: '',
      token: ''
    };

    this.onSubmit = this.onSubmit.bind(this);
    this.onChange = this.onChange.bind(this);

  }

  onSubmit(e) {
    console.log(this.state.email, this.state.password)
    e.preventDefault();
    var self = this;
    fetch('/signup', {
      method: 'POST',
      body: JSON.stringify(this.state)
    }).then(function (res) {
      if (res) {
        self.setState({ token: res })
        localStorage.setItem('token', self.state.token);
        window.location.reload();
    }
    })

  }

  onChange(e) {
    const { value, name } = e.target;
    this.setState({
        [name]: value
    });
}


  render() {
    return (
      <div className="Signup">

        <Jumbotron className="jumbotron-signup">
          <div className="left-row">
          <img src="assets/sign.svg" className="sign" alt="signup logo"/>
            <h1 className="title-signup">Sign Up</h1>
          </div>

          <form onSubmit={this.onSubmit}>

            <div className="row-signup">

              <div className="column-left">
                <div className="form-group">

                  <div className="left-row">
                    <label className="second-title-signup">First name</label>
                  </div>
                  <input type="firstname required" class="form-control" name="first-name" value={this.state.firstname} onChange={this.onChange}></input>
                </div>

                <div className="form-group">
                  <div className="left-row">
                    <label className="second-title-signup">Password</label>
                  </div>
                  <input type="password required" class="form-control" name="password" value={this.state.password} onChange={this.onChange}></input>
                </div>

                <div className="form-group">
                  <div className="left-row">
                    <label className="second-title-signup">Email</label>
                  </div>
                  <input type="email required" class="form-control" name="email" value={this.state.email} onChange={this.onChange}></input>
                </div>

              </div>

              <div className="column-right">
                <div className="form-group">
                  <div className="left-row">
                    <label className="second-title-signup">Last name</label>
                  </div>
                  <input type="lastname required" class="form-control" name="last-name" value={this.state.lastname} onChange={this.onChange}></input>
                </div>


                <div className="form-group">
                  <div className="left-row">
                    <label className="second-title-signup">Confirm password</label>
                  </div>
                  <input type="password required" class="form-control" name="passwordConfirm" value={this.state.password2}></input>
                </div>


                <div className="form-group">
                  <div className="left-row">
                    <label className="second-title-signup">Confirm email</label>
                  </div>
                  <input type="email required" class="form-control" name="confirm-email" value={this.state.email2} onChange={this.onChange}></input>
                </div>

              </div>
            </div>
            <div className="line"></div>
            <div className="left-row">
              <button type="submit" className="button-signup">Sign Up</button>
            </div>
          </form>


          <div className="left-row">
            <p className="first-paragraphe-signup">Already have an account? <Link to="/Subscribe/"><a href="/Signin">Sign In</a></Link></p>
          </div>
          <div className="left-row">
            <p className="second-paragraphe-signup">Or go <Link to="/"><a href="/">Home</a>.</Link></p>
          </div>
        </Jumbotron>
      </div>


    );
  }
}
